import React from 'react';

let a
function add(){
    let add = a+b;
    return add;
}

function sub(){
    let sub = a-b;
    return sub;
}

function mul(){
    let mul = a*b;
    return mul;
}

function div(){
    let div = a/b;
    div = div.toFixed(2);
    return div;
}

export {add, sub, mul, div};
